%[text] # Twist Boundary Condition 测试
%[text] $H=-t\\sum\_{m=1}^{N\_s-1}\\left(c\_mc\_{m+1}+h.c.\\right)-t\\left(e^{i\\theta}c\_{N\_s}^\\dagger c\_1+h.c.\\right)$
%[text] [用扭转边界降低晶格模型计算的有限尺寸效应 - 知乎](https://zhuanlan.zhihu.com/p/1899119702296474068)
%[text] ## 没有采用twist角时的收敛性计算，当$L\_x \>150${"editStyle":"visual"}时收敛。
clear;
tic;
Sys_Length = 2*ceil(logspace(log10(8),log10(500),10));
t = 1;
theta = 0;
Energy_Density = zeros(length(Sys_Length), 1);
for ii = 1: length(Sys_Length)
    Len_Loop = Sys_Length(ii);
    H = sparse(-t * diag(ones(Len_Loop-1, 1),1) - t * diag(ones(Len_Loop-1, 1),-1));
    H(1, end) = -t;
    H(end, 1) = -t;
    Ener_Ground = eig(H);
    Energy_Density(ii) = sum(Ener_Ground(Ener_Ground<0)) / Len_Loop;
end

plot(Sys_Length, Energy_Density,'-o','LineWidth',2) %[output:623acf77]
set(gca,'FontSize',14) %[output:623acf77]
set(gca,'linewidth',1) %[output:623acf77]
xlabel('L_x') %[output:623acf77]
ylabel('EnergyDensity') %[output:623acf77]

Converge_Ener_Density = Energy_Density(end);
disp(['Converged Energy Density is ', num2str(Converge_Ener_Density)]); %[output:4a86e2c1]
%%
%[text] ## 采用twist角时的收敛性计算, 随机选取
%[text] ### 横坐标为平均次数
%[text] 
Sys_Length = [16, 20, 30];

ave = 10:10:200;
Energy_Density = zeros(length(Sys_Length), length(ave));
for ii = 1: length(Sys_Length)
    Len_Loop = Sys_Length(ii);
    H = -t * diag(ones(Len_Loop-1, 1),1) - t * diag(ones(Len_Loop-1, 1),-1);
    
    for jj = 1:length(ave)
        temp_Energy = zeros(1, ave(jj));
        for kk = 1:ave(jj)
            phi = 2*pi*rand;
            H(1, end) = -t*exp(-1i * phi);
            H(end, 1) = -t*exp(1i * phi);
            Ener_Ground = eig(H);
            temp_Energy(kk) = sum(Ener_Ground(Ener_Ground<0)) / Len_Loop;
        end
        Energy_Density(ii,jj) = mean(temp_Energy);
    end
end
plot(ave, Energy_Density,'-o','LineWidth',2) %[output:72c15e36]
set(gca,'FontSize',14) %[output:72c15e36]
set(gca,'linewidth',1) %[output:72c15e36]
xlabel('N_\theta') %[output:72c15e36]
ylabel('EnergyDensity') %[output:72c15e36]

legend(arrayfun(@(x) ['L_x = ',num2str(x)], Sys_Length,'UniformOutput',false)) %[output:72c15e36]
%%
%[text] ## 采用twist角时的收敛性计算, 均匀选取
Sys_Length = [16, 20, 30];

ave = 10:10:200;
Energy_Density = zeros(length(Sys_Length), length(ave));
for ii = 1: length(Sys_Length)
    Len_Loop = Sys_Length(ii);
    H = -t * diag(ones(Len_Loop-1, 1),1) - t * diag(ones(Len_Loop-1, 1),-1);
    
    for jj = 1:length(ave)
        temp_Energy = zeros(1, ave(jj));
        phi = 2*pi*linspace(0,1,ave(jj));
        for kk = 1:ave(jj)
            H(1, end) = -t*exp(-1i * phi(kk));
            H(end, 1) = -t*exp(1i * phi(kk));
            Ener_Ground = eig(H);
            temp_Energy(kk) = sum(Ener_Ground(Ener_Ground<0)) / Len_Loop;
        end
        Energy_Density(ii,jj) = mean(temp_Energy);
    end
end
plot(ave, Energy_Density,'-o','LineWidth',2) %[output:9d70c5b2]
set(gca,'FontSize',14) %[output:9d70c5b2]
set(gca,'linewidth',1) %[output:9d70c5b2]
legend(arrayfun(@(x) ['L_x = ',num2str(x)], Sys_Length,'UniformOutput',false)) %[output:9d70c5b2]
xlabel('N_\theta') %[output:9d70c5b2]

ylabel('EnergyDensity') %[output:9d70c5b2]
disp(['Converged Energy Density is ', num2str(Energy_Density(end,end))]); %[output:4763583b]
disp(['Compared to non twist case, the difference is ', num2str((Energy_Density(end,end) - Converge_Ener_Density)/Converge_Ener_Density)]) %[output:49417cda]
toc; %[output:38c6b531]

